import React, { useState, useEffect } from "react";
import axios from "axios";
import Buttoni from "../Buttoni/Buttoni";
import Smska from "../Smska/Smska";
import Buttoniany from "../Buttoniany/Buttoniany";
import Export from "../Export/Export";
import ButtonsForAccept from "../ButtonsForAccept/ButtonsForAccept";
import TradeCurrency from "../TradeCurrency/TradeCurrency";
import './Dialog.css'

export default function Dialog({ yourmessage }) {
    const [valutate, setValutate] = useState('');
    const [message, setMessage] = useState('');
    const [banker, setBank] = useState('');
    const [messages, setMessages] = useState([]);
    const [input, setInput] = useState("");

    const comissia = () => {
        setMessages(prev => [
            ...prev,
            { sender: 'user-message', text: '–†–∞—Å—Å—á–∏—Ç–∞–π –∫–æ–º–∏—Å—Å–∏—é' },
            {
                sender: 'bot-message',
                component: (
                    <Buttoni
                        first="–í—ã–±–µ—Ä–∏ –≤–∞–ª—é—Ç—É"
                        buttons={['–†—É–±–ª–∏', '–ï–≤—Ä–æ', '–î–æ–ª–ª–∞—Ä—ã']}
                        onClickHandler={valuta}
                    />
                ),
            },
        ]);
    };

    useEffect(() => {
        setMessages([
            { sender: 'user-message', text: yourmessage },
            {
                sender: 'bot-message',
                component: (
                    <Buttoniany
                        first="–ü—Ä–∏–≤–µ—Ç, —Å —á–µ–º –∫–æ–Ω–∫—Ä–µ—Ç–Ω–æ —Ç–µ–±–µ –ø–æ–º–æ—á—å?"
                        buttons={['–ö–æ–º–∏—Å—Å–∏—è', ' üí±–û–±–º–µ–Ω –≤–∞–ª—é—Ç—ã', '–í–∫–ª–∞–¥—ã']}
                        onClickHandler={[comissia, trade_valuta, vkladi]}
                    />
                ),
            },
        ]);
    }, []);

    const countries = () => {
        setMessages(prev => [
            ...prev,
            { sender: 'bot-message', text: '–í—ã–±–µ—Ä–∏ —Å—Ç—Ä–∞–Ω—É –≤ –∫–æ—Ç–æ—Ä—É—é —Ö–æ—á–µ—à—å —Å–¥–µ–ª–∞—Ç—å –ø–µ—Ä–µ–≤–æ–¥' },
            {
                sender: 'repeat-bot-message', component: (
                    <>
                        <Export />
                        <button className={'button'} onClick={valuta}>–ü–æ–¥—Ç–≤–µ—Ä–¥–∏—Ç—å</button>
                    </>
                )
            }
        ]);
    }

    const vkladi = () => {
        console.log('poka');
    };

    const trade_valuta = () => {
        setMessages(prev => [
            ...prev,
            { sender: 'user-message', text: '–û–±–º–µ–Ω –≤–∞–ª—é—Ç—ã' },
            {
                sender: 'bot-message', component: (<TradeCurrency />)
            },
            {
                sender: 'repeat-bot-message', component: (
                    <Buttoniany
                        first="–ú–æ–∂–µ—Ç —Ç–µ–ø–µ—Ä—å –Ω—É–∂–Ω–∞ –ø–æ–º–æ—â—å —Å —á–µ–º-—Ç–æ –¥—Ä—É–≥–∏–º?"
                        buttons={['–ö–æ–º–∏—Å—Å–∏—è', '–û–±–º–µ–Ω –≤–∞–ª—é—Ç—ã', '–í–∫–ª–∞–¥—ã']}
                        onClickHandler={[comissia, trade_valuta, vkladi]}
                    />
                )
            }
        ]);
    };

    const valuta = (val) => {
        setValutate(val);
        setMessages(prev => [
            ...prev,
            { sender: 'user-message', text: val },
            { sender: 'bot-message', text: '–ù–∞–ø–∏—à–∏ —Å—É–º–º—É –∫–æ—Ç–æ—Ä—É—é —Ç—ã —Ö–æ—á–µ—à—å –ø–µ—Ä–µ–≤–µ—Å—Ç–∏' },
        ]);
    };

    const Sendtoback = async (data) => {
        try {
            const response = await axios.post("http://127.0.0.1:8000/", data, {
                headers: { "Content-Type": "application/json" },
            });
            console.log("–£—Å–ø–µ—à–Ω—ã–π –æ—Ç–≤–µ—Ç –∏ –¥–∞–Ω–Ω—ã–µ –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω—ã", response.data);
        } catch (error) {
            console.error("–û—à–∏–±–∫–∞ –ø—Ä–∏ –æ—Ç–ø—Ä–∞–≤–∫–µ –¥–∞–Ω–Ω—ã—Ö:", error);
        }
    };

    const bank = (bankik, summa) => {
        setBank(bankik);
        setMessages(prev => [
            ...prev,
            { sender: 'user-message', text: bankik },
            {
                sender: 'bot-message',
                text:
                    `–î–∞–≤–∞–π—Ç–µ –ø–æ–ª–Ω–æ—Å—Ç—å—é –ø—Ä–æ–≤–µ—Ä–∏–º –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏—é:\n` +
                    `–í–∞–ª—é—Ç–∞: ${valutate}\n` +
                    `–°—É–º–º–∞: ${summa} ${valutate}\n` +
                    `–ë–∞–Ω–∫: ${bankik}`,
            },
            {
                sender: 'repeat-bot-message',
                component: (
                    <button className="button" onClick={() => Sendtoback({ valutate, summa, bank: bankik })}>
                        –í—Å–µ –≤–µ—Ä–Ω–æ
                    </button>
                ),
            },
        ]);
    };

    const handleSend = (e) => {
        e.preventDefault();
        const trimmed = input.trim();
        if (!trimmed) return;

        setMessages(prev => [...prev, { sender: 'user-message', text: trimmed }]);

        if (valutate && !message) {
            const msg = trimmed;
            if (!isNaN(msg) && isFinite(msg) && Number(msg) > 0) {
                if (valutate && !message) {
                    setMessage(msg);
                    setMessages(prev => [
                        ...prev,
                        {
                            sender: 'bot-message',
                            component: (
                                <ButtonsForAccept
                                    first={'–í—ã–±–µ—Ä–∏ –±–∞–Ω–∫'}
                                    buttons={['–°–±–µ—Ä–±–∞–Ω–∫', '–¢-–±–∞–Ω–∫', '–°–æ–≤–∫–æ–º–±–∞–Ω–∫']}
                                    onClickHandler={bank}
                                    sums={msg}
                                />
                            ),
                        },
                    ]);
                }
            } else {
                setMessages(prev => [
                    ...prev,
                    { sender: 'bot-message', text: '–¢—ã –≤–≤–µ–ª –Ω–µ–≤–µ—Ä–Ω–æ–µ —á–∏—Å–ª–æ' },
                ]);
            }
        }

        setInput("");
    };

    return (
        <>
            <Smska
                input={input}
                handleSend={handleSend}
                setInput={setInput}
                messages={messages}
            />
            <button
                onClick={() => window.location.reload()}
                className="button-cleaning"
            >
                –û—á–∏—Å—Ç–∏—Ç—å —á–∞—Ç
            </button>
        </>
    );
}
